        /// <summary>
        /// Try getting data fro mthe entryid first, then use variant name as a fallback
        /// </summary>
        public static OrganicItem Lookup ( long? entryId, string edname_variant, bool skipGenus = false )
        {
            OrganicItem item;
            item = LookupByEntryId( entryId, skipGenus );
            if ( !item.exists )
            {
                item = LookupByVariant( edname_variant, skipGenus );
            }

            return item;
        }

            /// <summary>
            /// This was initially the preferred method but found that there
            ///     are multiple entry IDs for the same variant or they have
            ///     been changed so out lookup table may be innacurate.
            /// </summary>
            public static OrganicItem LookupByEntryId ( long? entryId, bool skipGenus = false )
        {
            OrganicItem item = new OrganicItem();
            if ( entryId != null )
            {
                if ( EntryIdData.ContainsKey( (long)entryId ) )
                {
                    LookupEntryId data = EntryIdData[ (long)entryId ];

                    //System.Windows.Forms.MessageBox.Show( "EntryID " + entryId.ToString() + " Found.\nGenus = "+data.genus+"\nSpecies = "+data.species+"\nVariant = "+data.variant );

                    if ( !skipGenus )
                    {
                        item.genus.name = rmOrganicGenusName.GetString( data.genus );
                        item.genus.description = rmOrganicGenusDesc.GetString( data.genus );
                    }
                    item.species.name = rmOrganicSpeciesName.GetString( data.species );
                    item.species.description = rmOrganicSpeciesDesc.GetString( data.species );
                    item.species.conditions = rmOrganicSpeciesCond.GetString( data.species );

                    item.variant = rmOrganicVariantName.GetString( data.variant );

                    SampleDistance.TryGetValue( data.genus, out item.genus.distance );
                    SpeciesData.TryGetValue( data.variant, out item.variantData );

                    item.SetExists( true );
                }
            }
            return item;
        }

        /// <summary>
        /// Populate objects with codex/extra information from the variant name.
        /// </summary>
        /// <param name="edname_variant">i.e. Stratum_02_F</param>
        /// <param name="skipGenus">Do not set Genus data. Used if SetGenus was previously used, no need to do it again.</param>
        /// <returns></returns>
        public static OrganicItem LookupByVariant ( string edname_variant, bool skipGenus=false )
        {
            OrganicItem item = new OrganicItem();
            if ( edname_variant != "" )
            {
                if ( VariantData.ContainsKey( edname_variant ) )
                {
                    LookupVariant data = VariantData[ edname_variant ];

                    //System.Windows.Forms.MessageBox.Show( "EntryID " + entryId.ToString() + " Found.\nGenus = " + data.genus + "\nSpecies = " + data.species + "\nVariant = " + data.variant );

                    if ( !skipGenus )
                    {
                        item.genus.name = rmOrganicGenusName.GetString( data.genus );
                        item.genus.description = rmOrganicGenusDesc.GetString( data.genus );
                    }
                    item.species.name = rmOrganicSpeciesName.GetString( data.species );
                    item.species.description = rmOrganicSpeciesDesc.GetString( data.species );
                    item.species.conditions = rmOrganicSpeciesCond.GetString( data.species );

                    item.variant = rmOrganicVariantName.GetString( data.variant );

                    SampleDistance.TryGetValue( data.genus, out item.genus.distance );
                    SpeciesData.TryGetValue( data.variant, out item.variantData );

                    item.SetExists( true );
                }

            }

            // If the above fails to find an entry then we return the empty item
            // We could modify the item to say that we could not find an entry as well
            return item;
        }

        public static OrganicGenus SetGenus ( string edname_genus )
        {
            OrganicGenus item = new OrganicGenus();

            item.name = rmOrganicGenusName.GetString( edname_genus );
            item.description = rmOrganicGenusDesc.GetString( edname_genus );

            return item;
        }

